function EnableSoftwareControl()
{    
    var report = GetReport(0x0F, 0x03, 0x47);

    report[2] = 0x3F; // transaction id.

    report[11] = 0; // row index.

    report[13] = 15; // led count.

    report[89] = CalculateCrc(report);

    
    device.send_report(report, 91);    
}


